import React, { Component } from "react";
import { Link, withRouter } from "react-router-dom";
import { connect } from "unistore/react";
import { actions } from "../store";
import '../Pages/assets/css/Home.css';

import Navigation from '../Component/Navigation';
import Footer from '../Component/Footer';
import Testimoni from '../Component/Testimoni';
import Search from '../Component/Search';
import ListMobil from '../Component/GetAllMobil';

class HomePage extends Component {
    componentDidMount = async () => {
        // const self = this;
        this.props.getAllMobil();
    }
  render() {
    return (
        <section>
            <Navigation />
            <Search/>
            <div className="container">
	            <div className="row" id="ads">
                  {this.props.listMobil.map((item, key) => {
                        const merk_mobil = item.merk_mobil !== null ? item.merk_mobil : "";
                        const model_mobil = item.model_mobil !== null ? item.model_mobil : "";
                        const transmisi = item.transmisi !== null ? item.transmisi : "";
                        const jarak_tempuh = item.jarak_tempuh !== null ? item.jarak_tempuh : "";
                        const tahun = item.tahun !== null ? item.tahun : "";
                        const tipe_bahan_bakar = item.tipe_bahan_bakar !== null ? item.tipe_bahan_bakar : "";
                        const warna_mobil = item.warna_mobil !== null ? item.warna_mobil : "";
                        const harga = item.harga !== null ? item.harga : "";
                        const judul_lapak = item.judul_lapak !== null ? item.judul_lapak : "";
                        const deskripsi_lapak = item.deskripsi_lapak !== null ? item.deskripsi_lapak : "";
                        return <ListMobil key={
                            key
                        }
                        merk_mobil = {
                            merk_mobil
                        }
                        model_mobil = {
                            model_mobil
                        }
                        transmisi = {
                            transmisi
                        }
                        jarak_tempuh = {
                            jarak_tempuh
                        }
                        tahun = {
                            tahun
                        }
                        tipe_bahan_bakar = {
                            tipe_bahan_bakar
                        }
                        warna_mobil = {
                            warna_mobil
                        }
                        harga = {
                            harga
                        }
                        judul_lapak = {
                            tipe_bahan_bakar
                        }
                        deskripsi_lapak = {
                            deskripsi_lapak
                        } />
                    })}
                  <div className="col-md-4">
                      <div className="card rounded">
                          <div className="card-image">
                              <span className="card-notify-badge">Price Reduced</span>
                              <span className="card-notify-year">2018</span>
                              <img className="img-fluid" src="https://imageonthefly.autodatadirect.com/images/?USER=eDealer&PW=edealer872&IMG=USC80HOC091A021001.jpg&width=440&height=262" alt="Alternate Text" />
                          </div>
                          <div className="card-image-overlay m-auto">
                              <span className="card-detail-badge">Used</span>
                              <span className="card-detail-badge">$22,000.00</span>
                              <span className="card-detail-badge">8000 Kms</span>
                          </div>
                            <div className="card-body text-center">
                              <div className="ad-title m-auto">
                                  <h5>Honda Accord Hybrid LT</h5>
                              </div>
                              <Link to="product_detail" className="ad-btn" >View</Link>
                            </div>
                        </div>
                    </div>
                  </div>
                </div>
            <Testimoni/>
            <Footer />
        </section>
    );
  }
}
export default connect("is_login, listMobil", actions)(withRouter(HomePage));
